import React, {Component} from 'react';


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
}));


class Home extends Component {
    render() {
        return (
            <div>
                This is home component
            </div>
        );
    }
}

export default Home;
